import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './ClothingCatalog.module.css';

const clothingItems = [
  { id: 1, name: 'Classic T-Shirt', price: '$29.99', image: '/assets1/man.png' },
  { id: 2, name: 'Denim Jacket', price: '$89.99', image: '/assets1/Frame 1597881673.png' },
  { id: 3, name: 'Casual Pants', price: '$49.99', image: '/assets1/Frame 1597881674.png' },
  { id: 4, name: 'Sweater', price: '$69.99', image: '/assets1/Frame 1597881674 (1).png' },
  { id: 5, name: 'Polo Shirt', price: '$39.99', image: '/assets1/polo-style.png' },
  { id: 6, name: 'Hoodie', price: '$59.99', image: '/assets1/man.png' }
];

export default function ClothingCatalog() {
  const navigate = useNavigate();
  const [isFavorite, setIsFavorite] = useState(false);

  const handleClose = () => {
    navigate(-1);
  };

  const toggleFavorite = () => {
    setIsFavorite(!isFavorite);
  };

  return (
    <div className={styles.container}>
      {/* Header */}
      <div className={styles.header}>
        <button className={styles.closeButton} onClick={handleClose}>
          ‚úï
        </button>
        <div className={styles.sparkle}>‚ú®</div>
        <div className={styles.headerRight}>
          <button className={styles.iconButton}>üõí</button>
          <button 
            className={styles.iconButton}
            onClick={toggleFavorite}
          >
            {isFavorite ? '‚ù§Ô∏è' : 'ü§ç'}
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className={styles.mainContent}>
        <div className={styles.grid}>
          {clothingItems.map((item) => (
            <div key={item.id} className={styles.item}>
              <img src={item.image} alt={item.name} className={styles.itemImage} />
              <div className={styles.itemInfo}>
                <h3 className={styles.itemName}>{item.name}</h3>
                <p className={styles.itemPrice}>{item.price}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
